// Error Response
async function errorResponse(response) {
    const box = document.getElementById('response');
    if (response.status == 'success') {
        box.innerHTML = `<div class="response-box success">Berhasil membuat akun, silahkan <a href="../login">Log In</a></div>`;
    }
    else {
        box.innerHTML = `<div class="response-box failed">${response.message == undefined ? response : response.message}</div>`;
    }
}

// Enter
function setupEnterKeyNavigation(inputs) {
    inputs.forEach((inputId, index) => {
        document.getElementById(inputId).addEventListener('keydown', function(event) {
            if (event.key === 'Enter') {
                event.preventDefault();
                if (index < inputs.length - 1) document.getElementById(inputs[index + 1]).focus();
                else signupButton();
            }
        });
    });
}
const inputIds = ['name', 'email', 'password', 'cpassword'];
setupEnterKeyNavigation(inputIds);